import React from 'react'
import Contact from './Contact'
import P4 from './images/plain4.png'
import P1 from './images/plain1.png'
import P2 from './images/plain2.png'
import P3 from './images/plain3.png'
import contacts from './ContactData'


function ContactCard(props) {
  const contactDetails = contacts.map(contacts => {
    return <Contact name = {props.name} phone = {props.phone} email = {props.email} />
  })

  return (
    <div className='card-div'>
      {contactDetails}
    </div>
  );
}

export default function InfoSection() {
  return (
    <div className='infosection'>
      <h1>Meet Our Developers</h1>
      <ContactCard />
      <span>
        <button onClick className='class-button'>
          <h2>Sign Up</h2>
        </button>
        <p>It's Free!!!</p>
        <h2>Click here to check rewards</h2>
      </span>
    </div>
  );
}
